import React from  'react'

const TaskSpan= ({test = '', label, className}) =>{
    if(test == 'completed'){
        return <span className={className}>Completed task</span>
    }
    else  if(test == 'editing'){
        return <span className={className}>Editing task</span>
    }
    return <span className={className}>Active task</span>
}

export default TaskSpan;
